function menuLogo() {
    var logo = 'data:image/png;base64,';
    $('.book-summary')
        .prepend('<div style="text-align: center;"><a class="menu-logo"' +
            ' href="https://hawkular.gitbooks.io/hawkular-apm-user-guide/content/"><img style="margin-bottom: 0"' +
            ' src="' + logo + '"></a>' +
            '<h2 style="margin-top: 0">Hawkular-APM</h2></div>');

    $('nav a.custom-link')
        .css({'display': 'none'});
};

function headerLinks() {
    $('h1, h2, h3, h4, h5, h6').filter('[id]').each(function () {
        $(this).html('<a class="header-link" href="#'+$(this).attr('id')+'">' + $(this).text() + '</a>');
    });
}

menuLogo();
headerLinks();

gitbook.events.bind('page.change', menuLogo);
gitbook.events.bind('page.change', headerLinks);
